import React from 'react';
import Head from 'next/head';

export default class Index extends React.Component {
    render() {
        return (
            <section>
                <style jsx>
                    {`
                        
                        section {
                            background-color: #eeeeee;
                            width: 100%;
                            text-align:center;
                            position: relative;
                        }

                        div {
                            top: 30%;
                            position:absolute;
                        }

                        h1 {
                            color: #666;
                            margin:0;
                        }

                        `}
                </style>
                <style jsx global>{`
                    body { 
                        margin:0;
                        padding:0;
                        font-family: Helvectica, arial, sans-serif;
                        font-weight:100;
                    }
                `}</style>

                <div>
                    <h1>Reece Russell</h1>
                </div>
            </section>
        )
    }
}
